INSERT INTO `news` (`id`, `title`, `img`, `desc`, `source`, `news_type_id`, `main_syndicate_id`, `sub_syndicate_id`, `created_at`, `updated_at`, `created_by`, `updated_by`) VALUES
(1, 'نقيب المهندسين يفتتح إجراءات القرعة العلنية لبيع وحدات إسكان العبور', '/upload/News/1/News.jpg', 'نقيب المهندسين يفتتح إجراءات القرعة العلنية لبيع وحدات إسكان العبور\r\n\r\nافتتح المهندس هاني ضاحي، نقيب المهندسين اليوم السبت 19 أكتوبر إجراءات القرعة العلنية لطرح وحدات مشروع إسكان العبور والتي يبلغ عددها 184 وحده سكنية، وذلك بمقر قاعة الاحتفالات الكبرى بالنقابة العامة للمهندسين بحضور المهندس أحمد عثمان، وكيل النقابة ورئيس لجنة الإسكان، والمهندس محمود مغاوري، أمين عام النقابة، والمهندس مؤمن شفيق، أمين صندوق النقابة ، والمهندس أحمد المصري، مقرر لجنة الإسكان ورئيس لجنة القرعة، والمهندس فاروق الحكيم، مقرر لجنة القرعة،\r\nفي كلمته المقتضبة رحب نقيب المهندسين بالحضور ملقيًا الضوء على نشاط النقابة في مجال الإسكان، مشيرا الي ان مجلس النقابة الحالي يولي مشروعات الاسكان اهتمام خاص لافتا انه عندما تسلم مقاليد العمل بالنقابة كانت اغلب مشروعات الاسكان متعثرة وكانت هناك مشروعات قد توقف العمل بها تمام ولفت ضاحي في كلمته ان المجلس الحالي قام بإعادة هيكلة ادارة الاسكان وكذلك لجنة الاسكان وتابع بكل دأب خطوات المقاولين والاستشاريين وتابعت هيئة مكتب النقابة العامة خطوات تنفيذ المشروعات علي ارض الواقع وذلك بعمل زيارات دورية لمتابعة الموقف علي الطبيعة أولا باول لتصحيح مسار المشروعات والبدء في مشروعات جديدة مضيفا ان مجلس النقابة يراعي دوما البعد الاجتماعي في حزمة المشروعات المطروحة لافتا انه تم تخصيص قطعة أرض بالعلمين الجديدة للنقابة من قبل هيئة المجتمعات العمرانية ويتم حالياً دراسة كافة الأوجه للاستفادة منها عن طريق دراسة جدوى، حتى لا يقع على كاهل المهندسين تكاليف عالية وحتى يشعر المهندس أنها أفضل بالمقارنة مع أسعار السوق.\r\nواختتم \"ضاحي\" كلمته بتمنيه عقد لقاءات مستمرة مع زملائه وأبنائه المهندسين حتى في غير ما يخص لجنة الإسكان.\r\nوبدوره رحب المهندس محمود مغاوري بالمهندسين المتقدمين للقرعة، معربًا عن سعادته بالمشاركة الكبيرة والإقبال الملحوظ من قبل المهندسين، واعدًا الجميع بأن تبذل النقابة كل ما في وسعها من جهد للعمل على راحة أبناء المهنة في جميع المجالات وليس في مجال الإسكان فقط.\r\nوفي سياق متصل أشار المهندس مؤمن شفيق أمين الصندوق أن يوم الاثنين القادم الموافق 21/10/2019 سوف تجرى قرعة إسكان السادس من أكتوبر لطرح بيع 262 وحده سكينة\r\nيليها طرح 191 وحدة سكنية بمشروع التجمع الخامس وذلك يوم السبت الموافق 26/10/2019', 'نقابة المهندسين', 1, 5, NULL, '2019-10-21 10:59:45', '2019-10-21 10:59:45', 1, NULL),
(2, 'ندوة لشعبة الهندسة الكيميائية تجيب علي سؤال الساعة', '/upload/News/2/News.jpg', 'ندوة لشعبة الهندسة الكيميائية تجيب علي سؤال الساعة\r\nكيف تصبح مصر مركزا لتداول الطاقة في الشرق الأوسط ؟\r\n\r\nأكد عدد من خبراء الطاقة أن الموقع الجغرافي لمصر يؤهلها لأن تكون مركز إقليمي لتداول الطاقة وخاصة في الغاز والكهرباء.وقال الخبراء أن اتفاقية الجات مع أوربا واتفاقية الكوميسا مع الدول الأفريقية تفتح أمام مصرالأسواق الأفريقية التي تضم مليار و200 مليون مواطن أفريقي والأسواق الأوربية التي تضم عددا مماثلا من الأوربيين، وهو ما يمثل فرصة ثمينة ، يجب استغلالها تجاريا وصناعيا ، وهو ما سيحقق المعادلة الصعبة التي تنتظرها مصر منذ عقود طويلة، وهو أحداث انطلاقة اقتصادية كبيرة،و توفير الكثير من فرص عمل وجذب استثمارات أجنبية ضخمة\r\nوأشار الخبراء إلى أن مصر لكي تصبح مركز لتداول الطاقة فان عليها أن تتخطي عدد من التحديات أهمها تطوير المواني ، وامتلاك أماكن ضخمة لتخزين البترول والغاز\r\nجاء ذلك خلال ندوة \" \"مصر مركز تداول الغاز في الشرق الأوسط \" التي نظمتها شعبة الهندسة الكيمائية والنووية برئاسة المهندس خالد العطار مساء اليوم الاحد 13 أكتوبر 2019 ، وحاضر فيها المهندس شريف هدارة وزير البترول الأسبق ، وحضرها عدد من خبراء الطاقة ، في مقدمتهم المهندس أسامة كمال وزير البترول الاسبق واللواء مهندس مصطفي هدهود محافظ البحيرة الأسبق، وقيادات جمعية رواد الهندسة والتكنولوجيا\r\nفي بداية الندوة أكد المهندس خالد العطار رئيس شعبة الهندسة الكيمائية والنووية أن تحول مصر لمركز لتداول الطاقة في الشرق الأوسط ، قضية في غاية الأهمية وهي ناتج جديد لعبقرية الموقع الجغرافي لمصر\r\nومن جانبه قال المهندس شريف هداره وزير البترول الأسبق أن موقع مصر المتميز وسط أسواق ضخمة في اسيا وافريقيا وأوربا ، يؤهلها بالفعل لأن تكون مركز لتداول الطاقة ، ولكن لكي تصبح مصر مركزا لتداول الطاقة تحتاج إلى جانب موقعها المتميز إلي تحقيق عدة أمور في مقدمتها أن يكون لديها عدد أكبر من المواني ، وان تكون قادرة على نقل وتخزين كميات ضخمة مصادر الطاقة المختلفة من غاز وبترول ، وأن تكون قادرة على فرض تسعيرة لها، وأن تكون على استعداد لتحمل مخاطر سوق التداول الذي يخضع للعرض والطلب وبالتالي فهو ينطوي على عدد من المخاطر ، كما يجب أيضا فتح الأبواب أمام الشركات الدولية لكي تشارك في عمليات تداول الطاقة \"\r\nوأضاف \" تداول الطاقة في الشرق الأوسط يلزمه أن تتعاون دول المنطقة بما يحقق مصلحة الجميع \"، مشيرا إلى أن \" الغاز \" هو أفضل مصادر الطاقة الذي يمكن أن تصبح فيه مصر مركز لتداوله في الشرق الأوسط\r\nوقال المهندس أسامه كمال وزير البترول الأسبق أن مصر مؤهله أيضا لكي تكون مركز لتداول الكهرباء .. وقال \" مصر يمكنها بفضل اتفاقية الجات مع أوربا واتفاقية الكوميسا مع أفريقيا أن تقتحم الأسواق الأفريقية التي تضم حوالي مليار و200 مليون أفريقي والأسواق الأوربية التي تضم عددا مماثلا من الأوربيين ، ولكن علينا ألا نكتفي بأن نكون مجرد مخزن لتداول مصادر الطاقة وإنما علينا أن نسعي إلى تصنيع أكبر كمية منه ، وتحويله إلى منتجات بتروكيميائية وهو ماسيحقق لمصر المعادلة الصعبة التي ينتظرها المصريون منذ عقود طويلة وهي تحقيق عائد اقتصادي ضخم ،و توفير الكثير من فرص عمل وجذب استثمارات أجنبية ضخمة\r\nوأشار المهندس فاروق الحكيم رئيس شعبة الهندسة الكهربية إلى أن فرصة مصر كبيرة لكي تكون مركز إقليمي لتداول الكهرباء.. وقال : مصر مرتبطة كهربيا بليبيا ودول المغرب العربي ، ومرتبطة مع الأردن وسيتم الافتتاح الرسمي للارتباط الكهربي بين مصر والسودان قريبا ، و لولا ظروف القلاقل السياسية في المنطقة لامتد الارتباط الكهربي المصري إلى لبنان وسوريا والعراق ، وهذا الأمر وارد الحدوث عندما تهدأ الأحداث السياسية في تلك البلاد وبالتالي فإن مصر مهيأة بالفعل لكي تكون مركز إقليمي لتداول الكهرباء\"\r\nوقال الدكتور محمد الصاوي أن المستقبل للطاقة الجديدة والمتجددة ومصر تتميز بقدرات هائلة للطاقة الشمسية وطاقة الرياح وعليها أن تتوسع في الطاقة الهيدروجينية التي ستصبح الطاقة رقم واحد عالميا في المستقبل القريب\r\nومن جانبه وجه المهندس شريف الصيرفي أمين عام جمعية رواد الهندسة والتكنولوجيا الشكر لنقابة المهندسين ولشعبة الهندسة الكيميائية والنووية على استضافة الندوة', 'نقابة المهندسين', 1, 5, NULL, '2019-10-21 11:01:13', '2019-10-21 11:01:13', 1, NULL),
(3, 'السفير التشادي في ضيافة المهندسين', '/upload/News/3/News.jpg', 'بحضور المهندس مؤمن شفيق أمين صندوق النقابة العامة للمهندسين، والمهندس أحمد هشام- مقرر لجنة العلاقات الدولية ، وعدد من أعضاء لجنة العلاقات الدولية بالنقابة العامة للمهندسين\r\nقام السفير الأمين الدودو- سفير دولة تشاد بزرع شجرة بنادي المهندسين بأبوالفدا ‘‘ ليتزين النادي بشجرة تشاديه تنضم لباقي الدول الأفريقية التي قامت بزراعة أشهر أشجارها بالنادي.\r\nمن جانبه رحب المهندس مؤمن شفيق بالحضور معربًا عن سعادته لفتح آفاق جديدة مع دولة تشاد مشيرًا أن العلاقات المصرية التشادية ممتدة منذ القدم، لافتًا أن مصر جزء لا يتجزأ من القارة السمراء، ولفت شفيق في كلمته المقتضبة أن نقابة المهندسين ستفتح مجالات كثيرة في دولة تشاد سوءًا في المجال الهندسي أو قطاع الشركات والمستثمرين، موضحًا أن الثروة الحيوانية في تشاد يمكن أن تسهم في عمل مشروعات مشتركة، وخص شفيق الدكتور فضل جمعه الوزير المفوض بالشكر لإساهماته في توطيد العلاقات بين النقابة وسفارة تشاد.\r\nفيما أعرب السفير التشادي ‘‘الأمين الدودو‘‘ عن سعادته بالتعاون مع نقابة المهندسين المصرية، وقال إن جمهورية مصر العربية لها دور عظيم في أفريقيا بشكل عام وفي العالم العربي والإسلامي بشكل خاص، مؤكدًا أن مصر هي الشقيقة الكبري لدول القارة ولا يمكن أن ينسي التاريخ ما قدمته مصر من دعم على المستوى السياسي لحركات التحرر للدول الأفريقية وعلى المستوى العلمي لمن أراد التسلح بالعلم من أبناء أفريقيا ولم تتأخر مصر عن تلبية النداء.\r\nمضيفا أن دور مصر وقيادتها لأفريقيا بدأ منذ تولي الزعيم الراحل جمال عبدالناصر وهي الآن تعود للقيادة في عهد الرئيس السيسي الذي قام بزيارة عدة دول أفريقية، وكان أول من بادر بإطلاق حملة لمعالجة مليون أفريقي من الأمراض بقوافل وأمصال مصرية.\r\nوتقدم الدودو بالشكر لشركة المقاولون العرب كونها قامت بعمل عدة منشآت بتشاد لها سمات خاصة ومتميزة عن أي منشئات قامت بها أي شركة أخرى، وقال ‘‘إن المقاولون العرب تترك بصمه على أعمالها، لذا لها مكانه لدى الشعب التشادي‘‘.\r\nمن جانبه أشاد المهندس أحمد هشام- مقرر لجنة العلاقات الدولية بنقابة المهندسين بدور المهندسين في بناء أفريقيا، لافتا أنهم فقط من يستطيعوا البناء، معربًا عن سعادته لوجود أبناء اتحاد الطلبة بدولة تشاد موضحًا أنها المرة الأولى التي يحدث فيها هذا النوع من التواصل، متمنياً أن يمتد إلى باقي الاتحادات الطلابية بباقي دول أفريقيا، متمنيًا أن تكون دولة تشاد هي دولة المقر لتدريب باقي المهندسين من أبناء الدول المجاورة.\r\nمن جانبه أكد الدكتور فضل جمعه الوزير المفوض لدولة تشاد أن العلاقات المصرية التشادية تعود لقرون مشيرًا أن الكثير من أبناء تشاد وباقي دول أفريقيا تخرجوا من جامعات مصرية مثل جامعة الأزهر الشريف وجامعة الإسكندرية.\r\nوتحدثت المهندسة أماني خضير- عضو لجنة العلاقات الدولية بنقابة المهندسين مرحبة بالحضور مبدية سعادتها بالمشاركة في الوفد الذي ضم ممثلين من نقابة المهندسين وبعض الشركات والمستثمرين المصريين لحضور مؤتمر كبير بدولة تشاد، وتقدمت خضير بخالص الشكر للدكتور فضل جمعه كونه أول من أدخل الشركات المصرية لتشاد.\r\nفيما أشار المهندس عبدالخالق ياسين عضو لجنة العلاقات الدولية بالنقابة إلى أنه قد آن الأوان ليعود التقارب بين دول أفريقيا التي فرقها الاستعمار، مشيرًا أن شعوب الدول الأفريقية عانت كثيرًا من الاستنزاف والفقر والمرض، وأشار إلى أن لجنة العلاقات الدولية بنقابة المهندسين تحرص على التواصل والترابط بين الهيئات والنقابات الهندسية بدول القارة السمراء لدعم وتبادل الخبرات.\r\nفيما طرح المهندس باسم الزفتاوي- عضو اللجنة على الحضور المحاور الثلاثة التي يتم عليها تدريب المهندسين، وهي أسس التصميم للمباني من الناحية الكهربائية، والتدريب بمعامل شنايدر للتدريب على الجزء النظري، ثم زيارات الهيئات وشركات توزيع الكهرباء للتدريب على الجزء العملي.', 'نقابة المهندسين', 1, 5, NULL, '2019-10-21 11:02:34', '2019-10-21 11:02:34', 1, NULL),
(4, 'مشروع الرعاية الصحية 2019', '/upload/News/4/News.jpg', 'سيتم فتح باب الاشتراك وتجديد الاشتراك اعتبار من يوم السبت الموافق 2019-11-02 وحتى يوم الاربعاء الموافق 2020-1-29 وذلك بمقر النقابة العامة والنقابات الفرعية والنوادى', 'نقابة المهندسين', 1, 5, NULL, '2019-10-21 11:07:26', '2019-10-26 08:30:51', 1, 1),
(5, 'نقابة المهندسين تجرى اليوم قرعة لطرح 262 وحدة سكنية بمدينة أكتوبر لأعضائها', '/upload/News/5/News.jpg', 'تجرى النقابة العامة للمهندسين، اليوم الاثنين، قرعة إسكان السادس من أكتوبر لطرح بيع 262 وحده سكينة للمهندسين، ومن المقرر أن يتم إجراء قرعة جديدة لطرح 191 وحدة سكنية بمشروع التجمع الخامس، يوم السبت المقبل 26 أكتوبر 2019.', 'اليوم السابع', 1, 5, NULL, '2019-10-26 08:34:46', '2019-10-26 08:34:46', 1, NULL),
(6, 'نائب يحذر المهندسين من المبالغة فى رسوم تقارير سلامة المبانى عند التصالح', '/upload/News/6/News.jpg', 'حذر المهندس علاء والى عضو  مجلس النواب، ورئيس لجنة الإسكان السابق - نقابة المهندسين والمكاتب الاستشارية من استغلال المواطنين وتحصيل مبالغ مالية منهم بالمبالغة، مما قد يؤدى إلى استنزافهم، وذلك عند اللجوء إليهم  للحصول على تقارير السلامة الإنشائية والرسومات المعمارية المنصوص عليها، ضمن المستندات المطلوبة في اللائحة التنفيذية لقانون التصالح.\r\n \r\nحذر النائب  فى بيان اليوم، من أن هذا الأمر الذى قد يثير حالة من الغضب عند هؤلاء المواطنين، لشعورهم بعدم قدرتهم على تحمل كل هذه الأعباء، بالإضافة إلى سداد قيمة التصالح التي سوف تقررها اللجان الفنية.\r\n\r\nوشدد \" علاء والى \"، على عدم تحمل المواطن أية أعباء مالية قد تؤدى إلى عزوفه عن التصالح في مخالفته التي وقعت بحقه نتيجة كثرة الأعباء عليه، مشدداً على تخفيف العبء عن كاهل المواطنين، والتيسير عليهم لإنهاء إجراءات التصالح، وفقاً لتوجيهات القيادة السياسية .\r\n\r\nوطالب المهندس علاء والى عضو مجلس النواب وزارة الإسكان والمرافق من خلال  اللجان الفنية المشكلة والمعنية بتنفيذ قانون التصالح بمتابعة هذا الإجراء، وعدم استغلال المواطنين، وتحميلهم مبالغ مالية فوق طاقتهم من قبل المكاتب الاستشارية، نظير تقرير السلامة الانشائية والرسومات المعمارية', 'اليوم السابع', 1, 5, NULL, '2019-10-26 09:32:02', '2019-11-15 18:49:10', 1, 1),
