(10, 'فندق نيو رويال', 33, 1, 'رويال بالاس مرسى مطروح و احد من افضل فنادق مرسى مطروح, فندق نيو رويال بالاس مرسى مطروح يقدم مصايف مرسى مطروح.', 'ممنوع اصطحاب الحيوانات', 'مرسى مطروح', NULL, 4, 1, NULL, '2019-10-21 10:11:16'),
(16, 'ايلاند فيو', 104, 1, 'أفضل منتجعات شرم الشيخ منتجع آيلاند فيو، المتميز بكل ما يمنحه للضيوف من خدمات وتسهيلات متنوعة تناسب رغبة الضيوف في قضاء وقت ممتع، و صنف منتجع آيلاند فيو على انه وجهة مميزة وفريدة فالضيوف يحصلون على مجموعة خدمات ومساحة للاستقلالية والراحة يقع منتجع آيلاند فيو في شرم الشيخ ويربط الضيوف مع معالهم المميزة ومنها خليج نعمة 16.3 كم، والسوق الشعبي 23.7 كم، ومدينة الألعاب المائية أكوا بارك 16.4 كم، ومحمية رأس محمد 51.9 كم، وجزيرة تيران، وحديقة السلام، ومنتزه ألف ليلة وليلة تحتوي جميع غرف منتجع أيلاند فيو على شرفة مطلة على المسبح. الغرف مكيفة، ومجهزة بكافة وسائل الراحة اللازمة أثناء فترة الإقامة كما تضم كل غرفة جهاز تلفزيون مع القنوات الفضائية، ومكتب عمل وميني بار. ويحتوي الحمام على حوض استحمام ودش. يقدم المنتجع أنشطة ترفيهية منها ترفيه مسائي، وموظفو الترفيه، والغطس، وغوص، وبلياردو، وملعب للأطفال، وملعب تنس. يقدم المكان خدمات استشفاء وتاهيل من خلال مسبح خارجي (طوال العام)، ومساج، ومركز عافية وسبا، ومركز للياقة البدنية، وساونا. يقدم المكان خدمات متنوعة منها خدمة كونسيرج، وصراف آلي في الموقع، وتخزين الأمتعة، ومكتب استقبال على مدار 24 ساعة، وخدمة كي الملابس، والتنظيف الجاف للملابس، ومرافق غسيل الملابس، وفاكس / نسخ مستندات، وقاعات اجتماعات / ولائم. يقدم المكان خدمات تناول الطعام والشراب من خلال مطعم شيف جيرالد ريتشاردسون، ومطعم براسيري فرنسي النكهة والأطباق', 'ممنوع اصطحاب الحيوانات', 'منتجع أيلاند فيو يقترب من وجهات مميزة منها سوهو سكوير شرم الشيخ 700 متر، وخليج القرش 700 متر يقرب المنتجع من وجهات تسوق مميزة منها لاسترادا مول 11.4 كم، وهوليوود شرم الشيخ 13.5 كم. ويضع المكان الزوار بالقرب من وجهات تناول الطعام والشراب ومنها مطعم وبول بار الواحة 1.6 كم، وكافيه تشينو 700 متر. يقع منتجع أيلاند فيو على بعد 20 كم من محطة السوبرجيت شرم الشيخ، ويبعد مطار شرم الشيخ الدولي مسافة 11.3 كم. عرض اقل', NULL, 1, 1, '2019-10-21 09:59:23', '2019-10-21 10:12:40'),
(17, 'قريه سيناوى لاجون', 105, 1, 'قع Sinaway Lagoon Aquapark Hotel and Spa في رأس سدر، ويضم شاطئ خاص ومسبح خارجي ومركز للياقة البدنية، كما يوفر أنشطة الرياضات المائية وملعب للتنس أيضًا.\r\nتتميز جميع الوحدات بإطلالة على البحر والمسبح، وتشتمل كل وحدة على تلفزيون بشاشة مسطحة وميني بار، ويشتمل الحمام الخاص على دش ومجفف للشعر.\r\nيتم تقديم وجبة الإفطار في الغرفة أو في المطعم، كما يتوفر أيضًا ملعب للأطفال ومركز سبا.\r\nيقع شاطئ سيناواي على بعد مسافة قصيرة سيرًا على الأقدام من الفندق، بينما يبعد سوق حجازي مسافة 35 كم', 'لايوجد شروط', 'قريه سيناوى لاجون', NULL, 1, 1, '2019-10-21 10:16:16', '2019-10-21 10:18:40'),
(18, 'سميراميس', 4, 1, 'فندق سميراميس هو احد فنادق الاسكندرية ذو ال 3 نجوم، ويتميز بأسعاره المعقولة المناسبة لجميع فئات النزلاء من رجال أعمال أو للترفيه. تتميز الغرف في الفندق بديكورات عصرية وبأرضيات خشبية وأرائك مريحة وألوان زاهية، وقد تم تجهيزها بتكييف هواء، تلفزيون، مينى بار وحمامات خاصة تضم مرافق مياه ساخنة وباردة ولوازم استحمام مجانية، ويمكن للنزلاء الإستمتاع بتناول طعام الفطور في الغرفة أو في المطعم.. ويُقدم الفندق مجموعة مرافق خدماتية متميزة تتمثل في: خدمة كي الملابس، التنظيف الجاف للملابس، مرافق غسيل الملابس، مكتب استقبال على مدار 24 ساعة وخدمة الغرف.', 'لايوجد', 'يقع الفندق في مدينة الاسكندرية بالقرب من محطة الرمل الشهيرة بمدينة عروس البحر الابيض المتوسط، يبعد بحوالي مسافة 2.5 كم من مكتبة الإسكندرية، 6.4 كم من سان ستيفانو مول و 53 كم من مطار برج العرب الدولي.', NULL, 1, 0, '2019-10-21 10:23:30', '2019-10-21 10:23:30'),
(19, 'بورتو سويس بيتش', 106, 1, 'يضم بورتو ساوث بيتش (بورتو فاكيشين كلوب) مطعماً ومسبحاً موسمياً خارجياً وحديقة ومنطقة شاطئ خاص في العين السخنة، وتضم جميع الغرف تلفزيون مع قنوات فضائية وحمام خاص، بالإضافة لمكتب استقبال يعمل على مدار الساعة وخدمة الغرف للضيوف.\r\nتضم جميع الغرف في هذا المنتجع شرفة، كما تحتوي جميعها في بورتو ساوث بيتش (بورتو فاكيشين كلوب) على بياضات أسرّة ومناشف.\r\nيقدم مكان الإقامة بوفيه إفطار يومياً', 'لايوجد', 'بورتو سويس بيتش', NULL, 1, 1, '2019-10-21 10:28:59', '2019-10-21 10:29:09'),
(21, 'فندق ريحانة رويال بيتش', 104, 1, 'يقع ريحانة رويال في خليج نبق على خط البحر الأول، ويوفر غرفاً فسيحة مع شرفات مطلة على المسبح الخارجي أو جبل سيناء. ويضم منطقة شاطئ خاص على البحر الأحمر ومرافق السبا.\r\n\r\nتتميز الغرف العصرية المكيفة في ريحانة رويال بيتش ريزورت آند سبا بأقمشة دافئة وتم تزيينها بألوان محايدة. وتحتوي جميع الغرف على تلفزيون مع قنوات فضائية وميني بار. وتحتوي بعض الغرف على حوض مساج مائي أو دش.\r\n\r\nيوفر الفندق الإقامة الشاملة كلياً على مدار 24 ساعة، وتعتمد على المشروبات الغازية. تتوفر إمكانية تناول الطعام في الداخل وفي الهواء الطلق في مطاعم الفندق الـ 5 العالمية. وتشمل الخيارات وجبات انتقائية في مطعم Rossini المستوحى من الطراز الإيطالي والمأكولات البحرية الطازجة في مطعم Moon Light الرومانسي.\r\n\r\nيشمل السبا غرفة بخار تركية ومساج وساونا. يمكن للضيوف التشمس على كراسي الاستلقاء حول المسبح أو الاستمتاع بالمنزلقات المائية أو التنزه في حديقة ريحانة رويال بيتش المورقة،\r\n\r\nيقع مطار شرم الشيخ الدولي على بعد 13 كم، ويوفر المنتجع مواقف مجانية خاصة للسيارات في الموقع.', 'يرجى التحقق من متطلبات حصولكم على التأشيرة قبل السفر.\r\n\r\nيرجى الملاحظة أن سعر الفندق الشامل كلياً لا يشمل المشروبات الكحولية، وتشمل فقط\r\nالمشروبات الغازية.\r\n\r\nأن الحد الأقصى لعدد الأطفال الذين يتشاركون في أسرّة الوالدين هو 2، وسيتم تطبيق سعر الشخص البالغ على الطفل الثالث.', 'شرم الشيخ', NULL, 1, 1, '2019-10-26 12:44:58', '2019-11-10 14:48:12'),
