(26, 'شذا المدينة', 109, 1, 'قع شذا المدينة في مكان مثالي في منطقة المدينة المنورة المركزية في المدينة المنورة، على بعد 2 كم من المسجد النبوي وعلى بعد خطوات قليلة من البازار القديم و1.8 كم من مزايا مول، كما تشمل المرافق المتوفرة في مكان الإقامة هذا مطعماً ومكتب استقبال يعمل على مدار 24 ساعة وخدمة الغرف، بالإضافة إلى خدمة الواي فاي المجانية في جميع أنحائه، وتتوفر مواقف خاصة للسيارات في الموقع.\r\n\r\nيمكن للضيوف في هذا الفندق الاستمتاع بوجبة إفطار كونتيننتال أو بوفيه إفطار.\r\n\r\nتقع مقبرة البقيع على بعد 1.8 كم من شذا المدينة، في حين يبعد النور مول مسافة 4.1 كم عن مكان الإقامة، ويعتبر مطار الأمير محمد بن عبد العزيز الدولي المطار الأقرب لمكان الإقامة حيث يقع على بعد 15 كم.\r\n\r\nهذه المنطقة المفضلة من المدينة المنورة لدى ضيوفنا بناءً على التقييمات المستقلة.', 'يرجى الملاحظة أنه يجب أن تكون أي بطاقة ائتمان مستخدمة في الدفع المسبق أو الدفع في الموقع بنفس اسم الضيف ويجب تقديمها للتحقق منها عند تسجيل الوصول.\r\n\r\nيرجى العلم بأنه إذا لم يكن الضيف هو صاحب بطاقة الائتمان أو في حال عدم تقديم بطاقة الائتمان المستخدمة في وقت تسجيل الوصول فيتوجب على الضيف تقديم وسيلة دفع بديلة.\r\n\r\nيرجى الملاحظة أن الفندق لن يقبل أي مدفوعات مسبقة أو ودائع للحجوزات المستقبلية بدون تقديم بطاقة الائتمان أو تفويض من صاحب بطاقة الائتمان، كما يحتفظ بحقه في رفض الحجز في حال عدم الالتزام بهذه المتطلبات.\r\n\r\nيرجى العلم بأن الطلبات الخاصة بتوفير غرف متجاورة تخضع للتوافر في وقت تسجيل الوصول.\r\nيرجى إبلاغ Shaza Al Madina بشكل مسبق بوقت وصولك المتوقع. بإمكانك استخدام حقل الطلبات الخاصة أثناء عملية الحجز أو يمكنك التواصل مع مكان الإقامة مباشرةًً من خلال معلومات التواصل المذكورة في تأكيد الحجز.\r\n\r\nسيطلب من الضيوف عند تسجيل الوصول إظهار بطاقة هوية تحتوي على صورة شخصية وبطاقة ائتمان. يرجى ملاحظة أن جميع الطلبات الخاصة ستكون رهنًا بالتوافر وقد تستلزم تكاليف إضافية.', '', NULL, 1, 1, '2019-12-20 22:13:22', '2019-12-20 22:16:02'),
